import React from 'react';
import { Link } from '@reach/router';

import { StyleNavigation } from '../Styles/StyledNavigation';

const Navigation = () => (
    <StyledNavigation>
        <div className="navigation-content">
            <Link to="/">
                
            </Link>
        </div>
    </StyledNavigation>
)

export default Navigation;
